import React, { Fragment, useState } from "react";
import axios from "axios";

function Registration(){
    const [username, setUsername] = useState('')
    const [email, setEmail] = useState('')
    const [password, setPassword] = useState('')
    const [rePassword, setRePassword] = useState('')

    const handleUsernameChange = (value) => {
        setUsername(value);
    }
    const handleEmailChange = (value) => {
        setEmail(value);
    }
    const handlePasswordChange = (value) => {
        setPassword(value);
    }
    const handleRePasswordChange = (value) => {
        setRePassword(value);
    }

    const handleSave = () => {
        const data = {
            Username : username,
            Email : email,
            Password : password
        }
    }

    const url = '';

    axios.post(url, data).then((result) => {
        alert(result.data);
    })

    return(
        <Fragment>
            <div>Registration</div>

            <label>Username</label>
            <input type="text" id="txtUsername" placeholder="Enter Username" onChange={(e) => handleUsernameChange(e.target.value)} /><br></br>
            
            <label>Email</label>
            <input type="email" id="Email" placeholder="Enter Email" onChange={(e) => handleEmailChange(e.target.value)} /><br></br>
            
            <label>Password</label>
            <input type="password" id="Password" placeholder="Enter Password" onChange={(e) => handlePasswordChange(e.target.value)} /><br></br>

            <label>Password again</label>
            <input type="password" id="rePassword" placeholder="Enter Password" onChange={(e) => handleRePasswordChange(e.target.value)} /><br></br>

            <button onClick={() => handleSave()}>Save</button>
        </Fragment>

    )

}

export default Registration
